    #define  YY_LESS_LINENO(n) \
            do { \
                unsigned int yyl;\
                for ( yyl = n; yyl < surf_parse_leng; ++yyl )\
                    if ( surf_parse_text[yyl] == '\n' )\
                        --surf_parse_lineno;\
            }while(0)
    #define YY_LINENO_REWIND_TO(dst) \
            do {\
                const char *p;\
                for ( p = yy_cp-1; p >= (dst); --p)\
                    if ( *p == '\n' )\
                        --surf_parse_lineno;\
            }while(0)
    
